import React, { Component } from 'react';

class About extends Component {
  render() {
    return (
      <div>
        <div class="container mt-5">
          <div class="row">
            <div class="col-sm">About</div>
            <div class="col-sm">One of three columns</div>
          </div>
        </div>
      </div>
    );
  }
}

export default About;
